import logo from '../images/logo.png'
export default function Header() {
  return (
    <header className="bg-gray-900 p-6 shadow-lg">
      <div className="container mx-auto flex flex-col items-center">
        <img
          src={logo}
          alt="Forex and AI Logo"
          className="w-32 h-32 object-contain"
        />
        <h1 className="text-4xl font-bold text-white mt-4">Forex & AI Investment</h1>
        <p className="text-white text-lg mt-2">Unlock the power of AI in the Forex market</p>
      </div>
    </header>
  );
}
